import React, {Component} from "react";
import "./TodoElement.css"
class RenderTodoList extends Component{



    render(){
        var renderList = [];
        var renderContainer = this.props.contentsData;
        var i =renderContainer.length-1;
        while(i>=0){
            if(i === 0 && this.props._mode === 'editTodo'){
                renderList.push(<div className="todoMainElement_now" key={renderContainer[i].todolist}>{renderContainer[i].todolist}</div>);
            }else{
                renderList.push(<div className="todoMainElement" key={renderContainer[i].todolist}>{renderContainer[i].todolist}</div>);

            }
            i=i-1;
        }



        return(
            <div>
                {renderList}
            </div>
        )
    }
}

export default RenderTodoList;
